import "./order.css"
import Product from "../product/product.js"


function Order(props) {
    return (
      <div className="order" key={props.key}>
        <div className="orderTitle">Order â„–{props.key}</div>
        <div className="orderContent">
            <div className="orderText"><div className="orderTextTitle">DeliveryType:</div>{props.delivery_type}</div>
            <div className="orderText"><div className="orderTextTitle">Status:</div>{props.status}</div>
            <div className="orderText"><div className="orderTextTitle">Address:</div>{props.address}</div>
            <div className="orderText"><div className="orderTextTitle">Total:</div>{props.price} $</div>
            <div className="orderTextTitle">Products:</div>
            <div className="orderProducts">
                {props.products.map(prod => <Product 
                    name={prod.name} price={prod.price} key={prod.id}></Product>)}  
            </div>
        </div>
      </div>
    );
  }


  export default Order;
